import { ImageBackground, StyleSheet, View, Button, Text } from "react-native";

const Card = ({ name, status, imageUrl }) => (
  <View>
    <View>
      <ImageBackground
        source={imageUrl}
        resizeMode="cover"
        style={styles.image}
      />
    </View>
    <View>{/* Box  */}</View>
  </View>
);

const styles = StyleSheet.create({});

export default Card;
